import React, { useState, useEffect, useRef } from 'react';
import { NavLink } from 'react-router-dom';

import classes from './CarsList.module.css';

const CarsList = (props) => {
  let [isActive, setActiveTab] = useState(false);

  const pickCar = (event) => {
    const carId = event.target.dataset.id;
    props.pickedCar(carId);
  };
  const listCars = props.carsList.map((cars) => {
    return cars.map((car) => {
      return (
        <NavLink
          key={car.id}
          onClick={pickCar}
          data-id={car.id}
          activeClassName="selectedLink"
        >
          {car.brand} {car.series}
        </NavLink>
      );
    });
  });

  return (
    <div className={classes['cars-list']}>
      <div>{listCars}</div>
    </div>
  );
};

export default CarsList;
